import React, { Component } from "react";
import Messages from "./Messages";
import { randomColor, randomName } from "./components";
import "./App.css"

class App extends Component {
  state = {
    messages: [
      {
        text: "This is a test message!",
        member: {
          username: "bluemoon",
        },
      },
    ],
    member: {
      username: randomName(),
      color: randomColor(),
    },
  };

  render() {
    return (
      <div className="App">
        <Messages
          messages={this.state.messages}
          currentMember={this.state.member}
        />
      </div>
    );
  }
}

export default App;
